pub enum ContractError {
    Std(StdError),
    ParseError(String),
    InvalidId {
    },
    InvalidPreimage {
    },
    InvalidHash(usize),
    EmptyBalance {
    },
    NotExpired,
    Expired,
    AlreadyExists,
}

pub enum ExecuteMsg {
    Create(CreateMsg),
    Release {
        id: String,
        preimage: String,
    },
    Refund {
        id: String,
    },
    Receive(Cw20ReceiveMsg),
}

pub enum QueryMsg {
    List {
        start_after: Option<String>,
        limit: Option<u32>,
    },
    Details {
        id: String,
    },
}
